import react from 'react';
import "./AIChatBot.css";
import MainLayout from './layout';
import Navigation from './navigation/Navigation';

function AIChatBot() {
    return (
        <MainLayout>
        <div className="aichatbot-container">   
            <h1 className="aichatbot-title">Tutor</h1>
            <p className="aichatbot-subtitle">What can I help you with?</p>
            <div className="chatbox">
                <div className="messages">
                    <div className="message bot-message">
                        Hello! I'm your AI Tutor. How can I assist you today?
                    </div>
                </div>
                <div className="input-area">
                    <input type="text" className="chat-input" placeholder="Type your message..." />
                    <button className="send-button">Send</button>
                </div>
            </div>  
        </div>
        </MainLayout>
    );
}

export default AIChatBot;
